import React from 'react'
import SimpleImageSlider from 'react-simple-image-slider';
import banner from './bannerimage.json'

// const images = [
//   { url: "bannerimages/bannerimage1.png" },
//   { url: "bannerimages/bannerimage2.png" },
//   { url: "bannerimages/bannerimage3.png" }

// ];
var sliderOptions =
        {
            sliderId: "slider",
            effect: "17,13,1",
            effectRandom: true,
            pauseTime: 2800,
            transitionTime: 1200,
            slices: 14,
            boxes: 8,
            hoverPause: 1,
            autoAdvance: true,
            captionOpacity: 0.4,
            captionEffect: "fade",
            thumbnailsWrapperId: "thumbs",
            m: false,
            license: "mylicense"
        };



const BannerImg = () => {
    return (
        <>
            <div className="bannerslider">
                <SimpleImageSlider width={896}
                height={560}
                images={banner}
                showBullets={true}
                showNavs={true}
                autoPlay={true}
                autoPlayDelay={1}
                transition={sliderOptions}
                

                />
            </div>
        </>

    )
}

export default BannerImg;
